const Observable = require("tns-core-modules/data/observable").Observable;
// >> require-image-source
const imageSourceModule = require("tns-core-modules/image-source");
// << require-image-source
// >> require-file-system
const fileSystemModule = require("tns-core-modules/file-system");
// << require-file-system
function onNavigatingTo(args) {
    const page = args.object;
    const vm = new Observable();
    // >> image-source-from-resource
    const imgFromResources = imageSourceModule.fromResource("icon");
    // << image-source-from-resource
    vm.set("imageFromResources", imgFromResources);

    // >> image-source-from-local-file
    const folder = fileSystemModule.knownFolders.currentApp();
    const path = fileSystemModule.path.join(folder.path, "images/logo.png");
    const imageFromLocalFile = imageSourceModule.fromFile(path);
    // << image-source-from-local-file
    vm.set("imageFromResourcesLocalFile", imageFromLocalFile);
    // >> image-source-base64
    const imageFromBase64 = imageSourceModule.fromBase64(base64string);
    // << image-source-base64
    vm.set("imageFromBase64", imageFromBase64);
    page.bindingContext = vm;
}

const base64string = "";

exports.onNavigatingTo = onNavigatingTo;
